        ,
        
        
        "name": 
            "industrial waste material"
        ,
        "def": "Industrial wastes are liquid, solid and gaseous wastes originating from the manufacture of specific products.\" Glossary of Environment Statistics\\, Studies in Methods\\, Series F\\, No. 67\\, United Nations\\, New York\\, 1997., http://stats.oecd.org/glossary/detail.asp?ID=1340",
