            "citrus family (food source)"
        ,
        "def": "Rutaceae, commonly known as the rue or citrus family, is a family of flowering plants, usually placed in the order Sapindales.\\nCitrus is a common term and genus (*Citrus*) of flowering plants in the rue family, *Rutaceae*. Citrus is believed to have originated in the part of Southeast Asia bordered by Northeastern India, Myanmar (Burma) and the Yunnan province of China. Citrus fruit has been cultivated in an ever-widening area since ancient times; the best-known examples are the oranges, lemons, grapefruit, and limes."
