            "pod or seed vegetable (food source)"
        ,
        "def": "A legume  is a plant or its fruit or seed in the family *Fabaceae* (or *Leguminosae*). Legumes are grown agriculturally, primarily for their grain seed called pulse, for livestock forage and silage, and as soil-enhancing green manure. Well-known legumes include alfalfa, clover, peas, beans, chickpeas, lentils, lupin bean, mesquite, carob, soybeans, peanuts and tamarind. https://en.wikipedia.org/wiki/Legume\""
