        ,
        "def": "The chickpea or chick pea (*Cicer arietinum*) is a legume of the family *Fabaceae*, subfamily *Faboideae*. Its different types are variously known as gram, or Bengal gram, garbanzo or garbanzo bean, as well as the Egyptian pea. Its seeds are high in protein. It is one of the earliest cultivated legumes: 7,500-year-old remains have been found in the Middle East.https://en.wikipedia.org/wiki/Chickpea\"",
