        "def": "Fish are the gill-bearing aquatic craniate animals that lack limbs with digits. Most fish are ectothermic (\\\"cold-blooded\\\"), allowing their body temperatures to vary as ambient temperatures change, though some of the large active swimmers like white shark and tuna can hold a higher core temperature https://en.wikipedia.org/wiki/Fish\""
