            "oyster (food source)"
        ,
        "def": "Oyster is the common name for a number of different families of salt-water bivalve molluscs that live in marine or brackish habitats. In some species the valves are highly calcified, and many are somewhat irregular in shape. \\nTrue oysters are members of the family *Ostreidae*. This family includes the edible oysters, which mainly belong to the genera *Ostrea, Crassostrea, Ostreola, Magallana, Saccostrea*.  Pearl oysters are not closely related to true oysters, being members of a distinct family, the feathered oysters (*Pteriidae*). https://en.wikipedia.org/wiki/Oyster\""
