            "kale plant (food source)"
        ,
        "def": "Kale (also called Borecole) is a form of cabbage (*Brassica oleracea* Acephala Group) in which the central leaves do not form a head. It is considered to be closer to wild cabbage than most domesticated forms. The species *Brassica oleracea* contains a wide array of vegetables, including broccoli, cauliflower, and Brussels sprouts. The Cultivar Group Acephala also includes spring greens and collard greens, which are extremely similar genetically. Kale can be classified by leaf type: Curly leaved (Scots kales), Plain leaved, Rape kale, Leaf and spear (a cross between curly leaved and plain leaved kale), Cavolo nero (also known as black cabbage, Tuscan kale, Lacinato and dinosaur kale)   (\"",
