        "def": "The *Arecaceae* are a botanical family of perennial climbers, shrubs, acaules and trees commonly known as palm trees (owing to historical usage, the family is alternatively called Palmae). They are flowering plants, a family in the monocot order Arecales. Currently 181 genera with around 2600 species are known, most of them restricted to tropical and subtropical climates. Arecaceae have great economic importance, including coconut products, oils, dates, palm syrup, ivory nuts, carnauba wax, rattan cane, raffia, and palm wood. https://en.wikipedia.org/wiki/Arecaceae\""
