        "def": "The onion (*Allium cepa *L), also known as the bulb onion or common onion, is a vegetable that is the most widely cultivated species of the genus *Allium*. Its close relatives include the garlic, shallot, leek, chive,2 and Chinese onion. \\n This genus also contains several other species variously referred to as onions and cultivated for food, such as the Japanese bunching onion (*Allium fistulosum*), the tree onion (*A. \u00d7proliferum*), and the Canada onion (*Allium canadense*). The name \\\"wild onion\\\" is applied to a number of *Allium* species, but *A. cepa* is exclusively known from cultivation. https://en.wikipedia.org/wiki/Onion\"",
