        "def": "*Oryza sativa*, commonly known as Asian rice, is the plant species most commonly referred to in English as rice.  *Oryza sativa* contains two major subspecies: the sticky, short-grained *japonica* or *sinica* variety, and the nonsticky, long-grained *indica* variety. \\n Rice occurs in a variety of colors, including white, brown, black, purple, and red rices. Black rice (also known as purple rice) is a range of rice types, some of which are glutinous rice. Varieties include Indonesian black rice and Thai jasmine black rice. https://en.wikipedia.org/wiki/Oryza_sativa\"",
