        ,
        "def": "GRIN Nomen 300661 Vicia faba L. (broad bean, bell-bean, fava-bean, faba-bean); however ITIS Id. 26339 Vicia faba L. (horsebean). \\n\\n*Vicia faba*, the Broad Bean, Fava Bean, Field Bean, Bell Bean or Tic Bean, is a species of bean (*Fabaceae*) native to north Africa and southwest Asia, and extensively cultivated elsewhere. A variety is provisionally recognized: Vicia faba var. equina Pers. - Horse Bean.  Although usually classified in the same genus Vicia as the vetches, some botanists treat it in a separate monotypic genus *Faba*. The term fava bean (from the Italian fava, meaning \\\"broad bean\\\") is usually used in English speaking countries such as the US, however the term broad bean is the most common name in the UK.",
