            "zebu (food source)"
        ,
        "def": "Zebus (*Bos taurus indicus*), sometimes known as 'nothing cattle', are better-adapted to tropical environments than other domestic cattle. Their scientific name was originally *Bos indicus*, but this name is now deemed invalid by ITIS, who classify the zebu under *Bos taurus* along with all other domestic cattle, and their aurochs ancestors, domesticated in India about 10,000 years ago. The ancient species of *Bos nomadicus* cattle or even gaur may have contributed to the development of the zebus. There are some 75 known breeds, split about evenly between African breeds and South Asian ones. The major Zebu cattle breeds of the world include Gyr, Guzerat, Indu-Brazilian, Nellore, Ongole and Brahman. Zebu have humps, large dewlaps and ears. They have more sweat glands than European cattle (*Bos taurus*). They handle hot, humid climates well and have pest resistances not seen in European cattle. (\"",
