        "def": "*Vigna subterranea* (also known by its common names: Bambara nut, Boro (Yoruba), Bambara groundnut, Bambara-bean, Congo goober, earth pea, ground-bean, or hog-peanut) is a member of the family *Fabaceae*. The plant originated in West Africa. Vigna subterranea ripens its pods underground, much like the peanut (also called a groundnut). They can be eaten fresh or boiled after drying.",
