        ,
        
        
        "name": 
            "brewers yeast (food source)"
        ,
        "def": "Brewing yeasts may be classed as \\\"top-cropping\\\" (or \\\"top-fermenting\\\") and \\\"bottom-cropping\\\" (or \\\"bottom-fermenting\\\"). Top-cropping yeasts are so called because they form a foam at the top of the wort during fermentation. An example of a top-cropping yeast is Saccharomyces cerevisiae, sometimes called an \\\"ale yeast\\\". Bottom-cropping yeasts are typically used to produce lager-type beers, though they can also produce ale-type beers. These yeasts ferment well at low temperatures. An example of bottom-cropping yeast is *Saccharomyces pastorianus*, formerly known as *Saccharomyces carlsbergensis*.\\n\\\\n\\\\n*Saccharomyces pastorianus* is a yeast used industrially for the production of lager beer, and is named after Louis Pasteur. It is a synonym of the yeast species *Saccharomyces carlsbergensis*, which was originally described in 1883 by Emil Christian Hansen, who was working for the Danish brewery Carlsberg.",
